class Solution:
    def numberOfWays(self, corridor: str) -> int:
        if (cnt := corridor.count('S')) == 0 or cnt % 2 != 0:
            return 0
        MOD = 10**9 + 7
        curr = 0
        ans = 1
        seat_count = 0
        for ch in corridor:
            if seat_count == 0:
                if ch == 'S':
                    seat_count += 1
            elif seat_count % 2 == 0:
                if ch == 'P':
                    curr += 1
                elif ch == 'S':
                    if curr > 0:
                        ans *= (curr + 1)
                        curr = 0
                    seat_count = 1
            elif ch == 'S':
                seat_count += 1
        return ans % MOD

